        $data = json_decode($geojsonString);

        foreach ($data->features as $feature) {
            $properties = $feature->properties;
            $geometryData = $feature->geometry;

            if (empty($geometryData) || empty($geometryData->coordinates)) {
                $this->command->warn('Melewatkan data tanpa geometri.');
                continue;
            }

            // Siapkan nama pemilik, gunakan "No Data" jika kosong
            $namaPemilik = trim($properties->Name ?? '');
            if (empty($namaPemilik)) {
                $namaPemilik = 'No Data';
            }

            $polygons = [];
            foreach ($geometryData->coordinates as $polygonCoordinates) {
                $lineStrings = [];
                foreach ($polygonCoordinates as $ring) {
                    $points = array_map(function ($coordinate) {
                        // GeoJSON: [longitude, latitude]
                        // Point: (latitude, longitude) -> Perlu dibalik
                        if (is_array($coordinate) && isset($coordinate[0]) && isset($coordinate[1])) {
                            return new Point($coordinate[1], $coordinate[0]);
                        }
                        return null;
                    }, $ring);

                    $points = array_filter($points);

                    if (!empty($points)) {
                        $lineStrings[] = new LineString($points);
                    }
                }
                if (!empty($lineStrings)) {
                    $polygons[] = new Polygon($lineStrings);
                }
            }

            if (empty($polygons)) {
                $this->command->warn('Gagal membuat poligon untuk: ' . trim($properties->Name));
                continue;
            }

            $multiPolygon = new MultiPolygon($polygons);

            KepemilikanLahan::create([
                'nama_pemilik'          => $namaPemilik,
                'kecamatan_id'          => $kecamatanId,
                'lokasi_agropolitan_id' => $lokasiAgropolitanId,
                'geometri'              => $multiPolygon,
            ]);
        }

        $this->command->info('Seeding data kepemilikan lahan untuk Kecamatan Batu Mandi berhasil.');
    }
